import React, { Component } from 'react'
import util from './../../static/utils'
import Header from './../../components/header/header'
import { HOC } from './../../HOC'
import styles from './product.scss'
import {Carousel} from 'antd-mobile'

const load = function () {
    let _this = this;
    util._fetch('/m/item-'+_this.props.location.query.product_id+'.html',{},function (response) {
        _this.setState(response);
    })
};

class product extends Component{
    constructor(props){
        super(props);
        this.state = {
            images:[],
            data_detail:{images:[]},
            frameOverflow:'hidden',
            default_img_url:'data:image/jpeg;base64,'
        };
        this.hand_easing = this.hand_easing.bind(this);
    }
    componentWillMount(){
        load.call(this)
    }
    hand_easing(){
        this.setState({frameOverflow:'visible'})
    }
    render(){
        const {data_detail, goods_path, images, frameOverflow,default_img_url} = this.state;
        const {} = this.props;
        const imagesEle = (
            <Carousel frameOverflow={frameOverflow} autoplay infinite afterChange={(index,e) => {this.setState({ slideIndex: index })}}
                      cellSpacing={5} slideWidth={0.9} dots dotStyle={{backgroundColor:'#8f8f94'}} dotActiveStyle={{backgroundColor:'#FF5582'}} style={{overflow:'hidden',paddingTop:44}}>
                {data_detail.images.map(item=>{
                    return <div className={styles['img-box']} key={item.image_id}>
                        <img className={styles.img} key={item.image_id} src={images[item.image_id+'_l']?images[item.image_id+'_l']:default_img_url} onLoad={util.lazyLoad.bind(this,item.image_id,'l')}/>
                        <span className={images[item.image_id+'_l']?styles['img-back'] +' '+ styles.active:styles['img-back']}></span>
                    </div>
                })}
            </Carousel>
        );
        return <div className={styles['product']}>
            <Header headername=""/>
            {data_detail.images.length>0 ? imagesEle:null}
        </div>
    }
}
export default HOC(product);